Thank you 3D Reef Gear for your amazing donation of a $100 card to your store!

3D Reef Gear started in March of 2020 and has been in the reef hobby for over 6 years. They have been  3D printing  for 5 years and love that they were able to merge their hobbies together!

@3Dreefgear

We're on the hunt for  #deathpostive  books, which feature one of the following:
- memorial fireworks;
- space burial; 
- cardboard coffins;
- green cremation;
-  3D printing  with ashes.
Any recommendations would be much appreciated.
